import React from "react";
import "./styles.css";

import Card from "../Card/index";

function Products({ name1, name2, name3 }) {
  const list = [
    {
      id: 1,
      product: "https://www.almuerzodenegocios.com/wp-content/uploads/2015/04/FotoYogenAca.jpg",
      name: name1
    },
    { id: 2, product: "https://lh3.googleusercontent.com/proxy/Us-jzLP-avClyLgUaPJOS00kgk1X7d2cNj8pEdbq_2PtTvoVazrMmwILxB68C_6gz_vsnkj0LwxNOhbyFV2f0u67ETHTFTZ6OzvsCtoSp-Ux1H2JasQ6A98",
    name: name2 
  },
    { id: 3,
      product: "product3",
      name: name3
    }
  ];

  const renderList = list.map((item) => (
    <li key={item.id.toString()}>
      <Card data={item.product} name={item.name} />
    </li>
  ));


  return (
    <div className="container">
      <div className="title-container">
        <h1>Outros produtos que pode gostar:</h1>
      </div>
      <div className="products-line">
        <ul>{renderList}</ul>
      </div>
    </div>
  );
}

export default Products;
